script: |
  super -f text -I q9533.spq | sort > q9533.out

inputs:
  - name: q9533.spq
    data: |
      SELECT ALL + ( + - 4 ) * CAST ( NULL AS INTEGER ) + - col0 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT NULL NOT IN ( col0 * + + col1 / 57 + + + col2 / + col1 / col0 + col0, + col2 );
  - name: tab0

outputs:
  - name: q9533.out
    data: |
